import React from 'react'



const AboutUs = () => {
    const cardMediaData = [
    {
      title: " Web Development",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <DashboardIcon />,
    },
    {
      title: "Graphic Design",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <ToysIcon />,
    },
    {
      title: "Mobile Apps",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <PermDeviceInformationIcon />,
    },
    {
      title: "Marketing",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <AcUnitIcon />,
    },
  ];
    return (
        <div>
            this is about us
        </div>
    )
}

export default AboutUs
